import React from "react";
import "./notifications.scss";
import Notis from "./notis";
import data from "../../../jsonData/notificationdata.json.json";

const Notifications = () => {
  const notisdata = data.news;
  return (
    <div className="info">
      {notisdata.map((newsdata) => (
        <News icon={newsdata.icon} message={newsdata.message} />
      ))}
    </div>
  );
};

export default Notifications;
